	/* 模型初始化 */
void net_Init(ai_handle w_addr, ai_handle act_addr)
{
    ai_error err;

    err = ai_network_create(&network, AI_NETWORK_DATA_CONFIG);
    if (err.type != AI_ERROR_NONE) {
        printf("???? - code=%d code=%d\r\n", err.type, err.code);
        Error_Handler();
    }

    const ai_network_params params = AI_NETWORK_PARAMS_INIT(
            AI_NETWORK_DATA_WEIGHTS(w_addr),
            AI_NETWORK_DATA_ACTIVATIONS(act_addr)
    );

    if (!ai_network_init(network, &params)) {
        err = ai_network_get_error(network);
        printf("初始化失败 - code=%d code=%d\r\n", err.type, err.code);
        Error_Handler();
    }
}

/* 模型运行 */
void net_Run(float *pIn, float *pOut)
{
    ai_i32 batch;
    ai_error err;

    ai_buffer ai_input[AI_NETWORK_IN_NUM] = AI_NETWORK_IN;
    ai_buffer ai_output[AI_NETWORK_OUT_NUM] = AI_NETWORK_OUT;

    ai_input[0].n_batches = 1;
    ai_input[0].data = AI_HANDLE_PTR(pIn);
    ai_output[0].n_batches = 1;
    ai_output[0].data = AI_HANDLE_PTR(pOut);

    batch = ai_network_run(network, ai_input, ai_output);
    if (batch != 1) {
        err = ai_network_get_error(network);
        printf("运行失败 - code=%d code=%d\r\n", err.type, err.code);
        Error_Handler();
    }
}

